INSERT INTO `events` VALUES (1,'Documentary Film Making Competition on Theme : A Day in the Life of VANRAKHSHAK','<p>Pench Tiger Reserve and MP Tiger Foundation Society are happy to announce Documentary film competition on topic</p><p><br></p><p>\"A Day in the Life of Vanrakshak\"</p><p><br></p><p>Participation: Individual or in Team of 2 persons</p><p><br></p><p>Download the rules/guidelines/instructions from the link:</p><p>https://bit.ly/penchfilmrules</p><p><br></p><p><br></p><p>Important Dates:</p><p>Registration Opens: 16th May</p><p>Registration Closes: 10th June</p><p>Filming dates: Between 25th May to 25th June</p><p>Last Date to submit the final film: 15th July</p><p>Winner Announcement : International Tiger Day - 29th July 2022</p><p><br></p><p>Read all the rules/guidelines/instructions carefully before registering.&nbsp;</p><p><br></p><p>Link to register for the competition:&nbsp;</p><p>https://bit.ly/penchfilmregistration</p>','13','publish','en_US','2022-06-10','10:00AM - 12:00PM','0','0','292','MP Tiger Foundation Society',NULL,'https://www.mptigerfoundation.org/',NULL,'Pench Tiger Reserve','documentary-film-making-competition-on-theme--a-day-in-the-life-of-vanrakhshak','Pench Tiger Reserve',NULL,NULL,NULL,'2020-07-20 15:58:56','2022-06-04 07:49:08');
