uot;;mso-ascii-theme-font:\r\nmajor-latin;mso-hansi-theme-font:major-latin;mso-bidi-theme-font:major-latin\">Because\r\nof its geological structure and geographical location along with three wide and\r\nlarge mountain regions, Madhya Pradesh is blessed with a variety of Bio\r\nDiversity. In reality Madhya Pradesh is blessed in a lot of ways, be it the\r\ndivinely powers of God, the rich cultural heritage driven by history, the\r\nnatural endowments in terms of the rich flora and fauna which are present in\r\nour Protected Areas - National parks and Wildlife Sanctuaries. Remember the\r\npoem by \"Bhawani Prasad Mishra\"- \"Satpurakeghane jungle\"?\r\nYes, it was about the Satpura National Park which is situated in Madhya\r\nPradesh.</span></p><p class=\"MsoTitle\" style=\"text-align:justify\"><span lang=\"EN\" style=\"font-size:\r\n14.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-ascii-theme-font:\r\nmajor-latin;mso-hansi-theme-font:major-latin;mso-bidi-theme-font:major-latin\"><br></span></p><p class=\"MsoTitle\"><b><span lang=\"EN\" style=\"font-size:14.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin;mso-bidi-theme-font:\r\nmajor-latin\">FLORA OF MADHYA PRADESH:-<o:p></o:p></span></b></p><p class=\"MsoTitle\" style=\"text-align:justify\"><a name=\"_argafugbw3pm\"></a><span lang=\"EN\" style=\"font-size:14.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin;mso-bidi-theme-font:\r\nmajor-latin\">The state is massively rich in forest with Teak and Sal being the\r\nidentity of the state. The state is also home to miscellaneous forest which\r\ncomprise of Saja, Lendia, Dhaora,Arjun,Salai,TenduKasai,Palash,Bhirra,Dhobin,\r\nBija, Shisham,Amaltas, Kullu etc. Well, you can\'t ignore rich Bamboo\r\nthickets&nbsp; while venturing into the\r\nforests of Madhya Pradesh. And don\'t get surprised if you come across different\r\npatterns made by the trees entangling each other, it\'s the nature\'s blessing\r\nthat you will get to see a lot of creepers/climbers while going on the trip in\r\nthe vast wilderness of Madhya Pradesh.<o:p></o:p></span></p><p class=\"MsoTitle\" style=\"text-align:justify\"><span lang=\"EN\" style=\"font-size:\r\n14.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-ascii-theme-font:\r\nmajor-latin;mso-hansi-theme-font:major-latin;mso-bidi-theme-font:major-latin\">&nbsp;</span></p><p class=\"MsoTitle\"><a name=\"_jh65q0blpe53\"></a><b><span lang=\"EN\" style=\"font-size:14.0pt;line-height:115%;font-family:\r\n&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-ascii-theme-font:major-latin;mso-hansi-theme-font:\r\nmajor-latin;mso-bidi-theme-font:major-latin\">FAUNA of MADHYA PRADESH:-<o:p></o:p></span></b></p><p class=\"MsoTitle\" style=\"text-align:justify\"><span lang=\"EN\" style=\"font-size:\r\n14.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-ascii-theme-font:\r\nmajor-latin;mso-hansi-theme-font:major-latin;mso-bidi-theme-font:major-latin\">The\r\nJungles of Madhya Pradesh have a rich wide variety of species of fauna. According\r\nto latest Tiger census, MP has become synonymous with Tiger state. In recent\r\nyear few more census of other fauna were conducted after which Madhya Pradesh\r\nhas become the Leopard State, Wolf State, Vulture State and Gharial State as\r\nwell. <o:p></o:p></span></p><p class=\"MsoTitle\" style=\"text-align:justify\"><span lang=\"EN\" style=\"font-size:\r\n14.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-ascii-theme-font:\r\nmajor-latin;mso-hansi-theme-font:major-latin;mso-bidi-theme-font:major-latin\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</span></p><p class=\"MsoTitle\" style=\"text-align:justify\"><span lang=\"EN\" style=\"font-size:\r\n14.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-ascii-theme-font:\r\nmajor-latin;mso-hansi-theme-font:major-latin;mso-bidi-theme-font:major-latin\">The\r\nsafari ride in the Jungles of Madhya Pradesh accompanied with sightings of the\r\nRoyal Bengal Tiger, Leopard, Sloth bear, herds of Spotted deer &amp; Sambhar,\r\nBison, Wild Boar, Blue bull, Wild Dogs and many more land animals along with\r\nour winged friends like Indian Roller, Paradise flycatcher, Kingfisher,\r\nvultures, eagles, drango etc. is a visual delight to the tourists and other\r\nwildlife enthusiasts coming here from all over the world. Let\'s have a look at\r\nthe list of the Protected Areas of Madhya Pradesh.&nbsp;<o:p></o:p></span></p><p class=\"MsoTitle\" style=\"text-align:justify\"><span lang=\"EN\" style=\"font-size:\r\n14.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-ascii-theme-font:\r\nmajor-latin;mso-hansi-theme-font:major-latin;mso-bidi-theme-font:major-latin\"><br></span></p><p class=\"MsoTitle\" style=\"text-align:justify\"><span lang=\"EN\" style=\"font-size:\r\n14.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-ascii-theme-font:\r\nmajor-latin;mso-hansi-theme-font:major-latin;mso-bidi-theme-font:major-latin\">&nbsp;<o:p></o:p></span></p>','en_US','publish','2022-06-02 03:56:53','2022-06-04 00:17:26','all',NULL),(10,'Contact','contact-3',NULL,NULL,NULL,'en_US','publish','2022-06-03 04:39:13','2022-06-04 08:00:01','all','on');
