INSERT INTO `services` VALUES (1,'Kanha Tiger Reserve','fas fa-paw','en_US','18','305',NULL,'protected-areas','protected areas','Kanha National Park is situated in the Maikal range of Satpura hills in Madhya Pradesh and  has a total area of 1945 sq.km including...','publish','<p style=\"text-align: justify; \"><span lang=\"EN\" style=\"font-size: 11pt; line-height: 115%; font-family: Arial; color: rgb(0, 0, 0);\">Kanha National Park is situated in the Maikal range of Satpura hills in\r\nMadhya Pradesh and&nbsp; has a total area of\r\n1945 sq.km including the core and buffer areas. Kanha was declared as a Tiger\r\nReserve in 1973, the same year of the commencement of Project Tiger.</span><br></p>\r\n<p style=\"text-align: justify; \"><span lang=\"EN\" style=\"font-size: 11pt; line-height: 115%; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);\"><span style=\"font-family: Arial;\">The jungle has a beautiful landscape of forest&nbsp; </span><span style=\"font-family: Arial;\">covered with Sal, Saja, Harra, Mahua, Bamboo\r\netc. to name a few. You would often come across herds of deer species like-\r\nChital and Sambar in the grass meadows and near water bodies who would even\r\nstart posing when your vehicle stops by to see them! One cannot afford to\r\nforget the humongous amount of conservation efforts done by some eminent field\r\ndirectors of Kanha to bring back the Hard Ground Barasingha from the verge of\r\nextinction to now it being the real home of the Barasingha and the state animal\r\nof Madhya Pradesh.</span></span></p><p style=\"text-align: justify; \"><span lang=\"EN\" style=\"font-size: 11pt; line-height: 115%; font-family: Calibri, sans-serif;\"><span lang=\"EN\" style=\"font-size: 11pt; line-height: 115%; font-family: Arial; color: rgb(0, 0, 0);\">Given the rich variety of\r\nflora, one will also come across the big and mighty animals like tiger,\r\nleopard, sloth bear, bison, wild boar. Not to miss the seemingly harmless\r\nmembers of the Canidae family viz: Wild dogs, Jackal, fox and wolf.</span></span></p><p style=\"text-align: justify; \"><span lang=\"EN\" style=\"font-size: 11pt; line-height: 115%; font-family: Calibri, sans-serif;\"><span lang=\"EN\" style=\"font-size: 11pt; line-height: 115%; font-family: Arial;\"><span lang=\"EN\" style=\"font-size: 11pt; line-height: 115%; font-family: Arial; color: rgb(0, 0, 0);\">The jungle is also home to some avian fauna like Indian Pitta, Crested\r\nserpent eagle, Common teal, Indian roller, Hoopoe etc.</span></span></span></p><p style=\"text-align: justify; \"><span lang=\"EN\" style=\"font-size: 11pt; line-height: 115%; font-family: Calibri, sans-serif;\"><span lang=\"EN\" style=\"font-size: 11pt; line-height: 115%; font-family: Arial;\"><span lang=\"EN\" style=\"font-size: 11pt; line-height: 115%; font-family: Arial;\"><span style=\"font-size: 11pt; line-height: 115%; font-family: Calibri, sans-serif;\"><span lang=\"EN\" style=\"font-family: Arial; color: rgb(0, 0, 0);\">Kanha has allured tourists from India and\r\nall over the world owing to its picturesque landscape and has also done its\r\nbest in inspiring the author- “Rudyard Kipling” to write- “The Jungle Book.”</span></span></span></span></span></p><p style=\"text-align: justify; \"><div style=\"text-align: left;\"><b style=\"color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt;\"><span lang=\"EN\" style=\"font-size: 11pt; line-height: 115%; font-family: &quot;Arial Black&quot;;\">Tourism Zones in Kanha:</span></b></div><div style=\"text-align: justify;\"><span lang=\"EN\" style=\"font-size: 11pt; line-height: 115%; font-family: Arial; color: rgb(0, 0, 0);\">Kanha Tiger Reserve is divided into Core area and Buffer area. There are 5\r\nzones in the Core area namely: Kanha, Kisli, Sarhi, Mukki and a part of Phen\r\nsanctuary. And there are 3 zones in the Buffer area i.e. Khatia, Khapa and\r\nSijhora.</span></div><div style=\"text-align: justify;\"><span lang=\"EN\" style=\"font-size: 11pt; line-height: 115%; font-family: Arial; color: rgb(0, 0, 0);\"><b><span lang=\"EN\" style=\"font-size: 12pt; line-height: 115%; font-family: &quot;Arial Black&quot;;\">Best Time to visit:</span></b></span></div><div style=\"text-align: justify;\"><span lang=\"EN\" style=\"font-size: 11pt; line-height: 115%; font-family: Arial;\"><span lang=\"EN\" style=\"font-size: 12pt; line-height: 115%; font-family: Arial; color: rgb(0, 0, 0);\">The best time to visit Kanha is from mid October to the end of June.</span></span></div></p>','icon',NULL,NULL,'a:0:{}','2020-06-01 01:53:06','2022-06-04 09:11:00'),(2,'Bandhavgarh Tiger Reserve','fas fa-paw','en_US','18','301',NULL,'data-management','meta description example','Bandhavgarh is one of the most visited Parks of Madhya Pradesh owing to a good number of wildlife sightings including....','publish','<p style=\"text-align: justify; \"><span style=\"color: rgb(0, 0, 0);\"><span lang=\"EN\" style=\"font-size: 11pt; line-height: 115%; font-family: Arial;\">Bandhavgarh is one of the most visited Parks of Madhya Pradesh owing to a\r\ngood number of wildlife sightings including some rare species and avian fauna.\r\nIt is a part of the Central Indian Highlands and is located between the\r\nVindhyan Hills and the eastern flanks of Satpura hill ranges.</span><br></span></p>\r\n<p style=\"text-align: justify; \"><span lang=\"EN\" style=\"font-size: 11pt; line-height: 115%; font-family: Arial; color: rgb(0, 0, 0);\">When you enter from the main gate of Bandhavgarh, you will come across a\r\nboard with a Tiger saying- “Perhaps you may not have seen me, but don’t get\r\ndisappointed. I have seen you” However, it’s very rare when you don’t see a\r\ntiger in Bandhavgarh!</span></p><p class=\"MsoNormal\" style=\"text-align: justify; \"><span lang=\"EN\" style=\"font-family:&quot;Calibri&quot;,sans-serif;\r\nmso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin;mso-bidi-theme-font:\r\nmajor-latin\"><span style=\"font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\">The Tiger Reserve is divided into 3 main safari zones-</span> </span><span style=\"color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Arial;\">Tala Zone, Magadhi\r\nZone and Khitauli Zone.</span></span></span><span style=\"color: rgb(32, 33, 36); font-size: 11pt; font-family: Arial;\">The forest of Bandhavgarh is dominated by Sal trees and Bamboo bushes.\r\nHowever the jungle is also home to trees which are commonly found here like-\r\nDhaora, Saja, Arjun, Palash,</span><span style=\"color: rgb(32, 33, 36); font-size: 11pt; font-family: Arial;\">&nbsp; </span><span style=\"color: rgb(32, 33, 36); font-size: 11pt; font-family: Arial;\">Haldu,\r\nPeepal, Tendu etc.</span></p><p class=\"MsoNormal\" style=\"text-align: justify; \"><span lang=\"EN\" style=\"font-size: 11pt; line-height: 115%; font-family: Arial; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0);\">Owing to the rich variety\r\nof flora, you will also see a good number of faunal species. Some of them are\r\nSpotted deer, Sambhar, Barking deer, Wild dog, Jackal, Hyena, Wolf, Leopard,\r\nTiger, sloth bear, Indian Gaur etc. Apart from these, Bandhavgarh is also known\r\nto lure a lot of wildlife photographers from all around the globe with its\r\nAvian fauna. Commonly you will see- Peacock, Red Jungle Fowl, Kingfisher,\r\nIndian roller, Crested serpent eagle, Common teal, Adjutant stork, King vulture\r\netc.</span></p><p class=\"MsoNormal\" style=\"text-align: justify; \"><span lang=\"EN\" style=\"font-size: 11pt; line-height: 115%; font-family: Arial; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0);\"><b><span lang=\"EN\" style=\"font-size: 11pt; line-height: 115%; font-family: &quot;Arial Black&quot;; color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Area of Bandhavgarh Tiger reserve :</span></b><br></span></p><p class=\"MsoNormal\" style=\"text-align: justify; \"><span lang=\"EN\" style=\"font-size: 11pt; line-height: 115%; font-family: Arial; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0);\"><span lang=\"EN\" style=\"font-size: 11pt; line-height: 115%; font-family: Arial; color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">BTR is divided into Core\r\nand Buffer areas which total upto 1536 sq. km. Core areas include- Tala, magdhi\r\nand Khitauli and the Buffer areas include- Dhamokhar, Johila and Panpatha.</span><br></span><b><span lang=\"EN\" style=\"font-size: 11pt; line-height: 115%; font-family: &quot;Arial Black&quot;; color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Best time to visit:</span></b></p><p class=\"MsoNormal\" style=\"text-align: justify; \"><span lang=\"EN\" style=\"font-size: 11pt; line-height: 115%; font-family: Arial; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0);\">The best time to visit\r\nBandhavgarh is from 15th of October to 30th of June. However, BTR is jam packed\r\nin the tourist season because of a good number of tiger sightings, it is\r\nadvisable to do your online booking for the safari in advance.</span></p><p class=\"MsoNormal\" style=\"text-align: justify; \"><span lang=\"EN\" style=\"font-size: 11pt; line-height: 115%; font-family: Arial; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0);\"><b><span lang=\"EN\" style=\"font-size: 11pt; line-height: 115%; font-family: &quot;Arial Black&quot;; color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Points of interest:</span></b></span></p><p class=\"MsoNormal\" style=\"text-align: justify; \"><span lang=\"EN\" style=\"font-size: 11pt; line-height: 115%; font-family: Arial; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN\" style=\"font-size: 11pt; line-height: 115%; font-family: Arial; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0);\">The forest also has a\r\nmythological importance inculcated in itself. The name of Bandhavgarh is itself\r\nderived from the fact that Lord Rama gave this fort to his brother Lakshman to\r\nhave a watch at Lanka. That’s why the name- Bandhav= brother, Garh= fort. There\r\nare also places of importance like Sita Mandap, Badi gufa, Shesh Shaiyya,\r\nCharan ganga, Rampur hillock, Gopalpur lake, Raj Behera, Sehra etc.</span></span></p>','icon',NULL,NULL,'a:0:{}','2020-06-01 20:45:26','2022-06-04 09:11:29'),(3,'Pench Tiger Reserve','fas fa-paw','en_US','18','302',NULL,'data-science','cyber security','The area of the Pench Tiger Reserve and the surrounding area is the real story area of Rudyard Kipling\'s famous \"The Jungle Book\"...','publish','<p style=\"text-align: justify; \"><span id=\"docs-internal-guid-b27deb71-7fff-4a0b-01ff-0351a9a77fc9\"></span></p><p dir=\"ltr\" style=\"line-height:1.38;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span id=\"docs-internal-guid-43f3f3ba-7fff-f490-8c20-83f3c50049f8\"></span></p><p dir=\"ltr\" style=\"line-height:1.38;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#202124;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The area of the Pench Tiger Reserve and the surrounding area is the real story area of Rudyard Kipling\'s famous \"The Jungle Book\". The idea of Mongali is made from the pamphlet \"An Account of Wolves\'s Nurturing Children in their Dens\" by Sir William Henry Sliman. In 1831 there was a report of the arrest of a child who had grown up with wolves in village Satbavadi near Seoni. The place described in \"The Jungle Book\", the Vainganga River, its valley where Sher Khan was killed, the mountain ranges of village Kannivara and Sivani etc. are the actual places in the Seoni district. The forest areas of the Pench Tiger Reserve have a glorious history. Its natural beauty and richness is described in the Ain-i-Akbari and many other natural history books such as R.A. Strenthal\'s \"Sivni, Camp life in the Satpura\", James Forsyth \"High Lands of Central India\" and A. A Dunbar Brander \"Wild Animals of Central India\" etc. Pench Tiger Reserve was awarded to \"Best Maintain Tourist Friendly National Park\" Award under the National Tourism Prize 2006-07.</span></p><p dir=\"ltr\" style=\"line-height:1.38;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#202124;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"><br></span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38; text-align: justify;\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(32, 33, 36); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span id=\"docs-internal-guid-5bbcd6de-7fff-1273-65ac-c19d047114f4\"><span style=\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; font-family: &quot;Arial Black&quot;;\">Flora &amp; Fauna:</span></span></span></p><p dir=\"ltr\" style=\"line-height:1.38;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#202124;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The forests found in Pench Tiger Reserve are divided into three parts as follows: -</span></p><ul><li style=\"line-height: 1.38; text-align: justify; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#202124;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Southern tropical wet deciduous forest</span></li><li style=\"line-height: 1.38; text-align: justify; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#202124;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Southern tropical dry deciduous teak forest</span></li><li style=\"line-height: 1.38; text-align: justify; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#202124;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"><span id=\"docs-internal-guid-c2b05171-7fff-0fa9-e8ec-bc8071b9c4d2\"><span style=\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Southern tropical dry deciduous mixed forest</span></span><br></span></li></ul><p style=\"line-height: 1.38; text-align: justify; margin-top: 0pt; margin-bottom: 0pt;\"><br></p><p dir=\"ltr\" style=\"line-height:1.38;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#202124;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Dry mixed forest spreads in about one-third area of ??protected area. Whose main species are&nbsp; salai, pickle, moyan, tendu etc. Kahua (Arjuna), Jamuna, Guular and Saja are found along the banks of river streams. Trees of Mahua, Palash, Plum etc. are found scattered around the open forests of displaced areas of old villages. Teak forests are found in about one quarter area. There are about 82 types of grass species and Bamboo found in this forest area.</span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38; text-align: justify;\"><span style=\"font-size: 11pt; font-family: &quot;Arial Black&quot;; color: rgb(32, 33, 36); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br></span></p><p dir=\"ltr\" style=\"line-height:1.38;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#202124;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The major&nbsp; Carnivores are Tiger, leopard, wild cat, wild dog, hyena, jackal, fox, wolf, weasel among the vegetarian species, Gaur, Nilgai, Sambar, Chital, Chasinga, Chinkara, Wild Pig etc. are prominent. In this Tiger Reserve, birds of about 325 species can also be seen in various seasons of the year. In the sunny areas of the Totladoh reservoir situated inside the park limits, there is a lot of migratory birds seen in the cold season. Among the migratory birds, Ruddy shelduck, Pintail, Whistling Teal and Vegtel etc are prominent.</span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38; text-align: justify;\"><span style=\"font-size: 11pt; font-family: &quot;Arial Black&quot;; color: rgb(32, 33, 36); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br></span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38; text-align: justify;\"><span style=\"font-size: 11pt; font-family: &quot;Arial Black&quot;; color: rgb(32, 33, 36); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Best Time to visit:</span></p><p dir=\"ltr\" style=\"line-height:1.38;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(32, 33, 36); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"></span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38; text-align: justify;\"><span id=\"docs-internal-guid-0d730884-7fff-082e-caa0-a220292b280f\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(32, 33, 36); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The best time to visit the Reserve is 15 October to 30 June.</span></span><br></p>','icon',NULL,NULL,'a:0:{}','2020-06-01 21:38:39','2022-06-04 09:11:57'),(4,'Panna Tiger Reserve','fas fa-paw','en_US','18','306',NULL,'cloud-service','cyber security','Panna Tiger Reserve is a critical tiger habitat located in Vindhya Hill in northern Madhya Pradesh and fragile through...','publish','<p><span id=\"docs-internal-guid-00c44f7c-7fff-3c24-96f4-14240578172c\"></span></p><p dir=\"ltr\" style=\"line-height:1.38;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#202124;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Panna Tiger Reserve is a critical tiger habitat located in Vindhya Hill in northern Madhya Pradesh and fragile through dynamic dry deciduous forest. This land is characterized by extensive plateaus and gorges. It is a land of mesmerizing waterfalls, naturals, archaeological splendors, legends &amp; cultural richness. It is also the land of the Ken River, which lends it unparalleled beauty. This land is sounded by natural boundaries like in north, it is surrounded by teak forest &amp; in easte, it is surrounded by Teak-Kardhai mixed forest. The NE-SW running Vindhya Hill ranges links the eastern and western population of wild animals.</span></p><p dir=\"ltr\" style=\"line-height:1.38;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#202124;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"><br></span></p><p dir=\"ltr\" style=\"line-height:1.38;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#202124;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"><span id=\"docs-internal-guid-5bbcd6de-7fff-1273-65ac-c19d047114f4\"><span style=\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; font-family: &quot;Arial Black&quot;;\">Flora &amp; Fauna:</span></span></span></p><p dir=\"ltr\" style=\"line-height:1.38;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#202124;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"><span id=\"docs-internal-guid-5bbcd6de-7fff-1273-65ac-c19d047114f4\"><span style=\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; font-family: &quot;Arial Black&quot;;\"><span id=\"docs-internal-guid-6f75d53a-7fff-2104-0337-64c730e2cd15\"><span style=\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Tiger the king of the jungle, roams freely in this secure, though a bit small habitat alongwith his fellow beings leopard , wild dog , wolf , hyaena and smaller cats. Sloth bear&nbsp; has his most favourite home in the rock escarpments and undisturbed vales. The wooded areas are dotted with sambar the largest of Indian deers, chital&nbsp; and chowsingha . One can easily see Blue Bull&nbsp; and chinkara in most open areas in the grasslands, specially on the periphery. The avifauna comprises more than 200 species including a host of migratory birds. One can see White necked stork, Barheaded goose, Honey Buuzzard, Blossom headed Parakeet, Paradise flycatcher, Slaty headed Scimitar babbler including 5 species of Vultures. Dry and hot climate, in union with shallow Vindhyan soils has given rise to dry Teak and dry mixed forest. The dominating vegetation type is Miscellaneous Dry Deciduous forest interspread with grassland areas. Other major forest types are riverines, open grasslands, open woodlands with tall grasses and thorny woodlands. The characteristic floral species of this area include tree species such as Tectona grandis, Diospyros melanoxylon, Madhuca indica, Buchnania latifolia, Anogeissus latifolia, Anogeissus pendula, Lanneacoro mandelica, Bosswelia serrata etc. Major shrub species includes Lantana camera, Grewia sp., Nyctanthusarbortristis, Ixora sp., Zyziphusmauritiana, Zyziphusoenoplea, etc. The dominant grass species are Apludamutica, Themedaquadrivalvis, Meteropogoncontortus, Arishtida sp. etc.</span></span></span></span></span></p><p dir=\"ltr\" style=\"line-height:1.38;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#202124;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"><span id=\"docs-internal-guid-5bbcd6de-7fff-1273-65ac-c19d047114f4\"><span style=\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; font-family: &quot;Arial Black&quot;;\"><span id=\"docs-internal-guid-6f75d53a-7fff-2104-0337-64c730e2cd15\"><span style=\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\"><br></span></span></span></span></span></p><p dir=\"ltr\" style=\"line-height:1.38;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 11pt; font-family: &quot;Arial Black&quot;; color: rgb(32, 33, 36); background-color: rgb(255, 255, 255); font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Best Time to visit:</span></p><p dir=\"ltr\" style=\"line-height:1.38;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#202124;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The best time to visit the Reserve is 15 October to 15 June.</span></p><p dir=\"ltr\" style=\"line-height:1.38;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#202124;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"><br></span></p>','icon',NULL,NULL,'a:0:{}','2020-06-01 21:47:27','2022-06-04 09:12:27'),(5,'Satpura Tiger Reserve','fas fa-paw','en_US','18','297',NULL,'cloud-security','cyber security','Satpura Tiger Reserve is a habitat of 52 species of Mammals, 31 of Reptiles and 300 species of birds...','publish','<p style=\"text-align: justify; \"><span id=\"docs-internal-guid-3d61278b-7fff-8a47-f81e-e02f20eef82a\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(32, 33, 36); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Satpura Tiger Reserve is a habitat of 52 species of Mammals, 31 of Reptiles and 300 species of birds, out of which 14 are endangered. STR also a habitat of arboreal mammals like Flying Squirrel, Indian Giant Squirrel and Leaf nosed bats. Eurasian Otter and Smooth coated Otter are also found here. It is a unique park of M.P where pollution free activities like cycling, canoeing and trekking are allowed.</span></span></p><p style=\"text-align: justify; \"><span style=\"color: rgb(32, 33, 36); font-family: &quot;Arial Black&quot;; font-size: 11pt; white-space: pre-wrap;\">Flora &amp; Fauna:</span><br></p><ul><li style=\"line-height: 1.38; text-align: justify; margin-top: 0pt; margin-bottom: 0pt;\"><span id=\"docs-internal-guid-29d4bca1-7fff-07e1-46ed-ebe0531670c5\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(32, 33, 36); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Satpura Tiger Reserve Located in the south of the river Narmada, The forest of the Satpura ranges are rich in biodiversity and are inhabited by many endangered species. Keeping this specialty in mind, Satpura Tiger Reserve was declared as the first biosphere reserve of Madhya Pradesh in the year 1999. The high ranges of the Pachmarhi plateau are covered by Sal forests, whereas dense teak forests are spread over its lower hill ranges. Here, 26 species of Himalayan region and 42 species of Nilgiri areas are found. due to which Satpura Tiger Reserve also known as the northern extremity of Western Ghats.</span></span></li><li style=\"line-height: 1.38; text-align: justify; margin-top: 0pt; margin-bottom: 0pt;\"><span id=\"docs-internal-guid-29d4bca1-7fff-07e1-46ed-ebe0531670c5\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(32, 33, 36); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span id=\"docs-internal-guid-b111cb9e-7fff-0432-e250-c946d9808007\"><span style=\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">This large land is an important habitat for the protection of tiger. This area is home to almost 14 endangered species, among which Giant Squirrel, Indian Skimmer, Black Bellied Tern, Leaf-nosed Bat, etc. are the specialty of area. More than 300 species of birds found here, including Malaba Pied Hornbill, Malabar Whistling Thrush and Madhya Pradesh\'s state bird Paradise Flycatcher (Doodhraj). Apart from this, migratory birds such as Bar-headed Geese, Pintails, Spot-bills, spoon-bills, etc. also appear in large groups during the autumn. Eurasian otter has also been seen here in the past.</span></span></span></span><br></li></ul><p style=\"text-align: justify; \"><span style=\"color: rgb(32, 33, 36); font-family: &quot;Arial Black&quot;; font-size: 11pt; white-space: pre-wrap;\">Best Time to visit:</span><br></p><p style=\"text-align: justify; \"></p><p dir=\"ltr\" style=\"line-height:1.38;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span id=\"docs-internal-guid-4423d980-7fff-acb0-8c45-daed34816f4e\"></span></p><p dir=\"ltr\" style=\"line-height:1.38;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#202124;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The best time to visit the Reserve is 15 October to 30 June. Pachmari is open throughout the year for Tourist.</span></p>','icon',NULL,NULL,'a:2:{i:0;s:1:\"1\";i:1;s:1:\"2\";}','2020-06-01 22:15:10','2022-06-04 09:12:47'),(6,'Sanjay Dubri Tiger Reserve','fas fa-paw','en_US','18','304',NULL,'analytics','cyber security','Sanjay Tiger Reserve is a nature’s paradise, which is located in Sidhi district of Madhya Pradesh...','publish','<p dir=\"ltr\" style=\"line-height:1.38;text-align: justify;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;padding:0pt 0pt 12pt 0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#323232;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Sanjay Tiger Reserve is a nature’s paradise, which is located in Sidhi district of Madhya Pradesh. The reserve is as unique as the world-famous white tiger- “MOHAN” who was found and rescued by the then Maharaja of Rewa- Raja Martand Singh in 1951. In principal this reserve is also the mother of all White Tigers founds across the world presently. Sanjay Tiger Reserve is bestowed with rich floral and faunal diversity along with some of the critically endangered species. For a wildlife and nature enthusiast or someone who wants to explore into the deep woods, Sanjay Tiger Reserve has to be on their bucket list.</span></p><p dir=\"ltr\" style=\"line-height:1.38;text-align: justify;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;padding:0pt 0pt 12pt 0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#323232;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Sanjay Tiger Reserve’s core consists of Sanjay National Park which was was established in 1975, and Dubri Sanctuary because of which sometimes it is referred to as Sanjay Dubri Tiger Reserve in general public. The reserve is in the heart of Incredible India, Madhya Pradesh and its spread over an area of 1674.11 sq. km, comprising of Sanjay National park, Dubri Wildlife sanctuary along with some buffer areas from Sidhi and Shahdol districts of Madhya Pradesh. It is situated on the north-eastern corner of the state of Madhya Pradesh. It shares its border with Guru Ghasidas National Park in the south, which was actually the part of this Tiger Reserve before the formation of Chhattisgarh in the year 2000.</span></p><p dir=\"ltr\" style=\"line-height:1.38;text-align: justify;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;padding:0pt 0pt 12pt 0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#323232;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">A person visiting STR will be mesmerized by the majestic high mountains, rivers which seem to pour out gold, the seemingly milky waterfalls and dense forest of Sal and Bamboo and much more…. And yes, our national animal, the Tiger has lived here since historic and pre- historic times. Sanjay had been earlier infamously known for having no tigers, however in starting off the journey from a “no tigerland” to becoming a tiger reserve, STR has come a long way.</span></p><p><span id=\"docs-internal-guid-eb5a2ab8-7fff-c8e6-22ea-9777c5b0cdca\"></span></p><p dir=\"ltr\" style=\"line-height:1.38;text-align: justify;background-color:#ffffff;margin-top:0pt;margin-bottom:12pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#323232;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The Reserve is mainly recognized for the presence of majestic Royal Bengal Tiger,which is the National Animal of India and practically one of the most fascinating animal in the world. The reserve with some of its dense forests, bamboo vegetations and vast grasslands along with some perennial streams, offers an excellent habitat for the solitary predator. Over the years, under the expert management practices of administrative body the reserve has witnessed a rise in number of the Tigersand also in other species of animals.Declared as a Tiger Reserve in 2006, the Reserve is blessed naturally as it is home to about 11 perennially flowing rivers like- Gopad, Banas, Neur, Umrari , Kormar, Mawai and Mohan. To add to its beauty, it has been testified that during monsoons Sanjay becomes even more alluring to the eyes.</span></p>','icon',NULL,NULL,'a:0:{}','2020-06-01 22:15:53','2022-06-04 09:13:05'),(34,'National Parks','nexicon-apple-1','en_US','20',NULL,'Coming Soon','national-parks','Coming soon','Coming Soon','publish','<h2 style=\"color: rgb(0, 0, 0); text-align: center;\"><img src=\"http://localhost/wildmp.com/assets/uploads/media-uploader/grid-wildmp-logo1654338847.png\" style=\"width: 350px;\"><span style=\"font-family: &quot;Arial Black&quot;;\"><br></span></h2><h1 styl